        {
            Author: 'Александр Иванов',
            Message: 'Привет! Как дела?'
        },

    )

    const renderMessage = (messages: any) => {
        return (
            <MainWrapper>
                <Messages>
                    {messages.map((message: any) => {

                    })}
                </Messages>
            </MainWrapper>
        )
    }

    return(
        <MainWrapper>
            <table>
                <Messages>
                <TableHeader>
                    <h1>Александр Иванов</h1>
                </TableHeader>
                {messages.map((message) => (
                    <TableBody>
                        <p>{message}</p>
                        <BottomBorder />
                    </TableBody>
                ))}
                </Messages>
            </table>
        </MainWrapper>
    )    
}

export default DetailMessages
